const LoadProjects=async()=>{let e="https://localhost:5001/projects",t=await fetch(e);if(t.ok){let e=await t.json();GenerateProjectCards(e)}else Debug("Connection error: "+t.status)},GenerateProjectCards=e=>{let t=document.getElementById("cards"),a="";for(let t=0;t<e.length;t++){let n=`<div id="card">\n        <a href="/project.html?projectid=${e[t].id}">\n        <button type="submit">\n        <img src="${e[t].imageA}'" alt="Image Text"/>\n        <h4>${e[t].name}</h4>\n        <p>${e[t].summary}</p>\n        </button>\n        </a>\n        </div>`;a+=n}t.insertAdjacentHTML("afterbegin",a)};(document.readyState="complete")&&LoadProjects();